import React from 'react';
import * as styles from './styles';

const Button: React.FunctionComponent<any> = () => {
  const handleClick = () => {
    console.log('aqui');
  };
  return (
    <button css={styles.Button} onClick={handleClick}>
      <span css={styles.ButtonSpan}>Button</span>
    </button>
  );
};

export default Button;
